// Filter Builder Components
function FilterRow({ filter, onUpdate, onRemove, discoveredFields }) {
  const operators = getOperatorsForField(filter.field);
  const currentOperator = operators.find(op => op.value === filter.operator);

  // Build field options with groups
  const fieldOptions = useMemo(() => {
    const options = [];

    // Add empty option
    options.push(html`<option value="">Select field...</option>`);

    // Common fields
    const commonFields = ['event', 'type', 'userId', 'anonymousId', 'timestamp'];
    const availableCommon = commonFields.filter(f => FLAT_FIELD_SCHEMA[f]);
    if (availableCommon.length > 0) {
      options.push(html`<optgroup label="Common">${
        availableCommon.map(f => html`<option value=${f}>${f}</option>`)
      }</optgroup>`);
    }

    // Schema fields by category
    Object.entries(FIELD_SCHEMA).forEach(([catKey, category]) => {
      const fields = Object.keys(category.fields)
        .filter(f => !commonFields.includes(f))
        .sort();
      if (fields.length > 0) {
        options.push(html`<optgroup label=${category.label}>${
          fields.map(f => html`<option value=${f}>${f}</option>`)
        }</optgroup>`);
      }
    });

    // Discovered fields
    if (discoveredFields && discoveredFields.length > 0) {
      const discovered = discoveredFields
        .filter(f => !FLAT_FIELD_SCHEMA[f])
        .sort();
      if (discovered.length > 0) {
        options.push(html`<optgroup label="Discovered">${
          discovered.map(f => html`<option value=${f}>${f}</option>`)
        }</optgroup>`);
      }
    }

    return options;
  }, [discoveredFields]);

  const needsValue = !currentOperator?.noValue;
  const isRange = currentOperator?.range;

  return html`
    <div class="as-filter-row ${isRange ? 'has-range' : ''}">
      <select
        class="as-filter-field-select"
        value=${filter.field}
        onChange=${(e) => onUpdate({ field: e.target.value, operator: 'equals', value: '' })}
      >
        ${fieldOptions}
      </select>

      <select
        class="as-filter-operator"
        value=${filter.operator}
        onChange=${(e) => onUpdate({ operator: e.target.value, value: '' })}
        disabled=${!filter.field}
      >
        ${operators.map(op => html`
          <option key=${op.value} value=${op.value}>${op.label}</option>
        `)}
      </select>

      ${needsValue && !isRange && html`
        <input
          type="text"
          class="as-filter-value"
          placeholder="Enter value..."
          value=${filter.value || ''}
          onInput=${(e) => onUpdate({ value: e.target.value })}
          disabled=${!filter.field}
        />
      `}

      ${isRange && html`
        <input
          type="text"
          class="as-filter-range"
          placeholder="Min"
          value=${filter.min || ''}
          onInput=${(e) => onUpdate({ min: e.target.value })}
          disabled=${!filter.field}
        />
        <span class="as-filter-range-sep">–</span>
        <input
          type="text"
          class="as-filter-range"
          placeholder="Max"
          value=${filter.max || ''}
          onInput=${(e) => onUpdate({ max: e.target.value })}
          disabled=${!filter.field}
        />
      `}

      <button
        type="button"
        class="as-filter-remove"
        onClick=${onRemove}
        title="Remove filter"
      >
        ×
      </button>
    </div>
  `;
}

function FilterBuilder({ filters, onChange, discoveredFields }) {
  const addFilter = useCallback(() => {
    const newFilter = {
      id: crypto.randomUUID(),
      field: '',
      operator: 'equals',
      value: '',
    };
    onChange([...filters, newFilter]);
  }, [filters, onChange]);

  const updateFilter = useCallback((id, updates) => {
    onChange(filters.map(f => f.id === id ? { ...f, ...updates } : f));
  }, [filters, onChange]);

  const removeFilter = useCallback((id) => {
    onChange(filters.filter(f => f.id !== id));
  }, [filters, onChange]);

  const clearAll = useCallback(() => {
    onChange([]);
  }, [filters, onChange]);

  const hasActiveFilters = filters.some(f => f.field && f.field !== '');

  return html`
    <div class="as-filter-container">
      ${hasActiveFilters && html`
        <div class="as-filter-header">
          <button type="button" class="as-filter-clear" onClick=${clearAll}>
            Clear all
          </button>
        </div>
      `}
      <div class="as-filter-builder">
        ${filters.map(filter => html`
          <${FilterRow}
            key=${filter.id}
            filter=${filter}
            onUpdate=${(updates) => updateFilter(filter.id, updates)}
            onRemove=${() => removeFilter(filter.id)}
            discoveredFields=${discoveredFields}
          />
        `)}
        <button type="button" class="as-filter-add" onClick=${addFilter}>
          + Add Filter
        </button>
      </div>
    </div>
  `;
}

