// Convert filters to simple match format for backend
function filtersToMatchString(filters) {
  if (!filters || filters.length === 0) return '';

  return filters
    .filter(f => f.field && f.operator && (f.operator === 'exists' || f.value))
    .map(f => {
      if (f.operator === 'exists') return `${f.field}:*`;
      return `${f.field}:${f.value}`;
    })
    .join(',');
}

// Parse match string back to filters (for backward compatibility)
function matchStringToFilters(matchString) {
  if (!matchString) return [];

  return matchString.split(',')
    .map(s => s.trim())
    .filter(Boolean)
    .map(pair => {
      const [field, value] = pair.split(':');
      return {
        id: crypto.randomUUID(),
        field: field?.trim() || '',
        operator: value === '*' ? 'exists' : 'equals',
        value: value === '*' ? '' : (value?.trim() || ''),
      };
    });
}

// API Key validation
function validateApiKey(key) {
  const trimmed = key.trim();

  if (!trimmed) {
    return { valid: false, message: '⚠️ API key is required' };
  }

  if (!trimmed.startsWith('key-')) {
    return {
      valid: false,
      message: '⚠️ Invalid format. Expected: key-[64 hex characters]',
      hint: 'API keys start with "key-" followed by 64 hexadecimal characters'
    };
  }

  const hash = trimmed.slice(4);
  if (hash.length !== 64) {
    return {
      valid: false,
      message: `⚠️ Hash must be exactly 64 characters (got ${hash.length})`,
      hint: 'Check if you copied the complete key'
    };
  }

  if (!/^[a-f0-9]+$/.test(hash)) {
    return {
      valid: false,
      message: '⚠️ Hash contains invalid characters',
      hint: 'Hash must only contain lowercase letters a-f and digits 0-9'
    };
  }

  return { valid: true, message: '✓ Valid API key format' };
}

