import java.util.Collections;
import java.util.LinkedHashMap;
import java.util.Map;
import java.util.Objects;

/**
 * Filtering definition supplied by developers when subscribing to the activity stream.
 *
 * <p>Combines exact field matches (logical AND semantics) with an optional free-text token. The
 * visual history limit is enforced server-side and bounded between {@value #MIN_LIMIT} and {@value
 * #MAX_LIMIT} as required by the specification.
 */
public record ActivityStreamFilter(Map<String, String> exactMatches, String freeText, int limit) {

  public static final int MIN_LIMIT = 1;
  public static final int MAX_LIMIT = 1000;
  public static final int DEFAULT_LIMIT = 50;

  /** Returns a filter with no field matches, no search term, and the default history cap. */
  public static ActivityStreamFilter empty() {
    return new ActivityStreamFilter(Map.of(), null, DEFAULT_LIMIT);
  }

  public ActivityStreamFilter {
    Map<String, String> sanitizedMatches = sanitizeMatches(exactMatches);
    String sanitizedSearch = sanitizeFreeText(freeText);

    int normalizedLimit = limit <= 0 ? DEFAULT_LIMIT : limit;
    if (normalizedLimit < MIN_LIMIT || normalizedLimit > MAX_LIMIT) {
      throw new IllegalArgumentException(
          "Activity stream limit must be between %d and %d".formatted(MIN_LIMIT, MAX_LIMIT));
    }

    exactMatches = sanitizedMatches;
    freeText = sanitizedSearch;
    limit = normalizedLimit;
  }

  private static Map<String, String> sanitizeMatches(Map<String, String> input) {
    if (input == null || input.isEmpty()) {
      return Collections.emptyMap();
    }

    Map<String, String> filtered = new LinkedHashMap<>();
    input.forEach(
        (key, value) -> {
          if (key == null || key.isBlank() || value == null) {
            return;
          }
          String normalizedKey = key.trim();
          String normalizedValue = value.trim();
          if (!normalizedKey.isEmpty() && !normalizedValue.isEmpty()) {
            filtered.put(normalizedKey, normalizedValue);
          }
        });

    return Collections.unmodifiableMap(filtered);
  }

  private static String sanitizeFreeText(String freeText) {
    if (freeText == null || freeText.isBlank()) {
      return null;
    }
    String trimmed = freeText.trim();
    return trimmed.isEmpty() ? null : trimmed;
  }

  /** Returns a new filter with the provided limit enforced against the specification bounds. */
  public ActivityStreamFilter withLimit(int newLimit) {
    return new ActivityStreamFilter(exactMatches, freeText, newLimit);
  }

  /** Returns a new filter using the provided exact matches map. */
  public ActivityStreamFilter withExactMatches(Map<String, String> newMatches) {
    return new ActivityStreamFilter(newMatches, freeText, limit);
  }

  /** Returns a new filter using the provided free-text token. */
  public ActivityStreamFilter withFreeText(String newFreeText) {
    return new ActivityStreamFilter(exactMatches, newFreeText, limit);
  }

  /** Convenience helper that returns {@code true} when no filtering has been requested. */
  public boolean isEmpty() {
    return exactMatches.isEmpty() && freeText == null;
  }

  @Override
  public String toString() {
    return "ActivityStreamFilter{"
        + "exactMatches="
        + exactMatches
        + ", freeText='"
        + Objects.toString(freeText, "")
        + "', limit="
        + limit
        + '}';
  }
}
