import com.contextsuite.inbox.dto.activity.ActivityEventView;
import com.contextsuite.inbox.dto.activity.ActivityStreamFilter;
import com.fasterxml.jackson.databind.JsonNode;
import java.util.ArrayList;
import java.util.LinkedList;
