import java.util.Locale;
import java.util.Map;
import java.util.Objects;
import java.util.Queue;
import java.util.stream.Stream;
import org.springframework.boot.autoconfigure.condition.ConditionalOnProperty;
import org.springframework.stereotype.Service;
import reactor.core.publisher.Flux;

/** Applies ActivityStreamFilter definitions to event streams using Reactor-friendly operators. */
@Service
@ConditionalOnProperty(
    value = "app.ui.activity-stream.enabled",
    havingValue = "true",
    matchIfMissing = true)
public class ActivityStreamFilterService {

  /** Filters the provided flux based on the supplied filter. */
  public Flux<ActivityEventView> filter(
      Flux<ActivityEventView> source, ActivityStreamFilter filter) {
    ActivityStreamFilter effective = filter == null ? ActivityStreamFilter.empty() : filter;
    return source.filter(event -> matches(event, effective));
  }

  /**
   * Returns {@code true} when the event satisfies both the exact-match criteria and the optional
   * free-text search specified by the filter.
   */
  public boolean matches(ActivityEventView event, ActivityStreamFilter filter) {
    if (filter == null || filter.isEmpty()) {
      return true;
    }
    if (!matchesExact(event, filter.exactMatches())) {
      return false;
    }
    return filter.freeText() == null || containsFreeText(event, filter.freeText());
  }

  private boolean matchesExact(ActivityEventView event, Map<String, String> matches) {
    if (matches == null || matches.isEmpty()) {
      return true;
    }
    for (Map.Entry<String, String> entry : matches.entrySet()) {
      String actual = resolveValue(event, entry.getKey());
      if (actual == null || !actual.equals(entry.getValue())) {
        return false;
      }
    }
    return true;
  }

  private boolean containsFreeText(ActivityEventView event, String query) {
    String needle = query.toLowerCase(Locale.ROOT);
    return Stream.of(
            event.eventId(),
            event.eventType(),
            event.partition(),
            event.region(),
            flattenSummary(event.summary()),
            event.payload().toString())
        .filter(Objects::nonNull)
        .map(value -> value.toString().toLowerCase(Locale.ROOT))
        .anyMatch(candidate -> candidate.contains(needle));
  }

  private String flattenSummary(Map<String, Object> summary) {
    if (summary == null || summary.isEmpty()) {
      return "";
    }
    List<String> values = new ArrayList<>();
    Queue<Object> queue = new LinkedList<>(summary.values());
    while (!queue.isEmpty()) {
      Object value = queue.poll();
      if (value == null) {
        continue;
      }
      if (value instanceof Map<?, ?> map) {
        queue.addAll(map.values());
      } else if (value instanceof Iterable<?> iterable) {
        iterable.forEach(queue::add);
      } else {
        values.add(value.toString());
      }
    }
    return String.join(" ", values);
  }

  private String resolveValue(ActivityEventView event, String expression) {
    if (expression == null || expression.isBlank()) {
      return null;
    }
    String trimmed = expression.trim();

    // Support explicit prefixes so callers can disambiguate between summary/payload metadata.
    if (trimmed.startsWith("summary.")) {
      return fromSummary(event.summary(), trimmed.substring("summary.".length()));
    }
    if (trimmed.startsWith("payload.")) {
      return fromPayload(event.payload(), trimmed.substring("payload.".length()));
    }

    return switch (trimmed) {
      case "partition" -> event.partition();
      case "region" -> event.region();
      case "eventType", "event_type" -> event.eventType();
      default -> {
        String summaryValue = fromSummary(event.summary(), trimmed);
        if (summaryValue != null) {
          yield summaryValue;
        }
        yield fromPayload(event.payload(), trimmed);
      }
    };
  }

  private String fromSummary(Map<String, Object> summary, String path) {
    if (summary == null || summary.isEmpty()) {
      return null;
    }
    String[] parts = path.split("\\.");
    Object current = summary;
    for (String part : parts) {
      if (!(current instanceof Map<?, ?> map)) {
        return null;
      }
      Object next = map.get(part);
      if (next == null) {
        return null;
      }
      current = next;
    }
    return current instanceof Iterable<?> iterable ? joinIterable(iterable) : current.toString();
  }

  private String fromPayload(JsonNode payload, String path) {
    if (payload == null || payload.isMissingNode()) {
      return null;
    }
    JsonNode node = payload;
    for (String part : path.split("\\.")) {
      node = node.path(part);
      if (node.isMissingNode()) {
        return null;
      }
    }
    if (node.isContainerNode()) {
      return node.toString();
    }
    if (node.isNull()) {
      return null;
    }
    return node.asText();
  }

  private String joinIterable(Iterable<?> iterable) {
    List<String> values = new ArrayList<>();
    for (Object element : iterable) {
      if (element != null) {
        values.add(element.toString());
      }
    }
    return String.join(",", values);
  }
}
